import React from 'react';
import './App.css';
import brain from './icons8-brain-96.png';


class App extends React.Component {

  constructor() {
    super()
    this.state={
      imageUrl: 'https://wallup.net/wp-content/uploads/2016/05/13/327288-face-women-model-short_hair-_Rebecca_Hall-portrait.jpg'
    }
  }

  updateImage = (_evnt) => {
    this.setState({imageUrl: _evnt.target.value});
    console.log(_evnt.target.value)
  }


  render() {
    return (
      <div className="App">
        <div className='navigation'>
          <button type='button' Id='navBtn' className='glassmorph'>Sign-In</button>
        </div>
        <div className='logo'>
          <span className='glassmorph'><img alt='brain logo' src={brain} width='100px' height='auto'/></span>
        </div>
        <div className='input'>
          <input className='glassmorph inputbox' type='text' onChange={this.updateImage} placeholder='Type image location here.'/><br/>
          <button type='button' className='glassmorph detectBtn'>Detect</button><br/>
        </div>
        <div className='imageSpace'>
          <img alt='face' src={this.state.imageUrl} width="500" height="auto"/>
        </div>
      </div>
    );
  }
}

export default App;
